import React from "react";

interface ProductItemProps {
  product: {
    id: number;
    title: string;
    price: number;
    image: string;
  };
}

const ProductItem: React.FC<ProductItemProps> = ({ product }) => {
  return (
    <div>
      <img src={product.image} alt={product.title} />
      <h3>{product.title}</h3>
      <p>{product.price} USD</p>
    </div>
  );
};

export default ProductItem;
